    return (
        <div>
            {
                peakData.map((peak) => (
                    <div className="peakContainer">
                        <h2>{peak.name}</h2>
                        <p>{peak.elevation}</p>
                    </div>
                ))
            }
        </div>
    )
}

export default MountainContainer;
